import React from "react";
import { Nav } from "react-bootstrap";
import "./Navbar.css";
import { scroller } from "react-scroll";

export default function Navbar() {
  const scrollToHome = () => {
    scroller.scrollTo("homeComponent", {
      duration: 800,
      delay: 0,
      smooth: "easeInOutQuart",
    });
  };

  const scrollToAbout = () => {
    scroller.scrollTo("aboutComponent", {
      duration: 800,
      delay: 0,
      smooth: "easeInOutQuart",
    });
  };

  const scrollToPortfolio = () => {
    scroller.scrollTo("portfolioComponent", {
      duration: 800,
      delay: 0,
      smooth: "easeInOutQuart",
    });
  };

  const scrollToContact = () => {
    scroller.scrollTo("contactComponent", {
      duration: 800,
      delay: 0,
      smooth: "easeInOutQuart",
    });
  };

  return (
    <div>
      {/* <Navbar expand="lg"> */}
      {/* <Navbar.Toggle aria-controls="navbarScroll" />
        <Navbar.Collapse id="navbarScroll"> */}
      <Nav className="navBar" sticky="top">
        <Nav.Item>
          <Nav.Link className="navItem" onClick={scrollToHome}>
            <h1>.Home</h1>
          </Nav.Link>
        </Nav.Item>
        <Nav.Item>
          <Nav.Link className="navItem" onClick={scrollToAbout}>
            <h1>.About</h1>
          </Nav.Link>
        </Nav.Item>
        <Nav.Item>
          <Nav.Link className="navItem" onClick={scrollToPortfolio}>
            <h1>.Portfolio</h1>
          </Nav.Link>
        </Nav.Item>
        <Nav.Item>
          <Nav.Link className="navItem" onClick={scrollToContact}>
            <h1>.Contact</h1>
          </Nav.Link>
        </Nav.Item>
      </Nav>
      {/* </Navbar.Collapse> */}
      {/* </Navbar> */}
    </div>
  );
}
